import React from "react";
import Logo from "../components/Logo";
//Appel la Navigation pour faire fonctionner la navigation
import Navigation from "../components/Navigation";
import "bootstrap/dist/css/bootstrap.css";
import Imggif from "../components/Imggif";

const Présentation = () => {
  return (
    <div>
      <Logo />
      <Navigation />
      <div className="saut"></div>
      <div className="container">
        <div className="row">
          <div className="col" style={{ width: "100%" }}>
            <Imggif />
          </div>

          <div className="col">
            C'est moi Je suis David LI, j'ai 20 ans et je suis actuellement en
            seconde année de BTS SIO option SLAM (Solutions Logicielles et
            Application Métier) au Lycée Polyvalent de Cachan
          </div>
        </div>
      </div>
    </div>
  );
};

export default Présentation;
